INSERT INTO `tcsteps` (`id`, `step_number`, `actions`, `expected_results`, `active`, `execution_type`) VALUES
(646, 1, '<p>\r\n	Ator seleciona no menu a op&ccedil;&atilde;o &quot;Manter Autor&quot;</p>\r\n', '<p>\r\n	Sistema exibe tela com lista de 05 autores cadastrados.</p>\r\n', 1, 1),
(647, 2, '<p>\r\n	Autor pressiona link &quot;Novo Autor&quot;</p>\r\n', '<p>\r\n	Sistema exibe formul&aacute;rio com campos em branco.</p>\r\n', 1, 1),
(648, 3, '<p>\r\n	Ator digita o nome &quot;Machado de Assis&quot; e pressiona o bot&atilde;o &quot;Gravar&quot;</p>\r\n', '<p>\r\n	Sistema exibe tela de confirma&ccedil;&atilde;o contendo o nome do autor &quot;Machado de Assis&quot; e solicita confirma&ccedil;&atilde;o.</p>\r\n', 1, 1),
(649, 4, '<p>\r\n	Ator pressiona bot&atilde;o &quot;Confirmar&quot;</p>\r\n', '<p>\r\n	Sistema grava dados em meio persistente.</p>\r\n', 1, 1),
(654, 1, '<p>\r\n	Ator seleciona no menu a op&ccedil;&atilde;o &quot;Manter Autor&quot;.</p>\r\n', '<p>\r\n	Sistema exibe uma tela com uma lista de 05 autores cadastrados.</p>\r\n', 1, 1),
(655, 1, '<p>\r\n	O usu&aacute;rio acessa a op&ccedil;&atilde;o no menu &quot;Consultar Autor&quot;.</p>\r\n', '<p>\r\n	O sistema exibe o campo &quot;Autor&quot; em branco e o bot&atilde;o &quot;Pesquisar&quot; e uma lista de autores cadastrados.</p>\r\n', 1, 1),
(656, 2, '<p>\r\n	Ator pressiona link &quot;Novo Autor&quot;.</p>\r\n', '<p>\r\n	Sistema exibe formul&aacute;rio com campos em branco.</p>\r\n', 1, 1),
(657, 1, '<p>\r\n	O usuario clica na op&ccedil;&atilde;o do menu &quot;Consultar Autor&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela para consultar Auotr</p>\r\n', 1, 1),
(658, 3, '<p>\r\n	Ator deixa o nome do autor em branco e pressiona o bot&atilde;o &quot;Gravar&quot;.</p>\r\n', '<p>\r\n	Sistema exibe a seguinte mensagem de erro &quot;O Nome do Autor deve ser Informado&quot;, com os bot&otilde;es &quot;Cancelar&quot; e &quot;Voltar&quot;.</p>\r\n', 1, 1),
(659, 1, '<p>\r\n	Ator seleciona no menu a op&ccedil;&atilde;o &quot;Emprestar Livro&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela contendo uma lista com 05 livros disponiveis que foram cadastrados previamente.</p>\r\n', 1, 1),
(660, 2, '<p>\r\n	O usu&aacute;rio digita o nome do autor &quot;Andr&eacute;s&quot; no campo destinado &agrave; pesquisa e clica em pesquisar.</p>\r\n', '<p>\r\n	O sistema exibe a mensagem de erro &quot;Este autor ainda n&atilde;o foi cadastrado no sistema.&quot;</p>\r\n', 1, 1),
(661, 2, '<p>\r\n	No campo &quot;Nome do Autor&quot; o usuario digita o nome &quot;Verissimo&quot; e logo ap&oacute;s clica no bot&atilde;o &quot;Consultar&quot;</p>\r\n', '<p>\r\n	Sistema exibe os seguintes dados:&nbsp;</p>\r\n<p>\r\n	Nome do Autor: Verissimo</p>\r\n<p>\r\n	Lista com 05 livros do autor &quot;Verissimo&quot;</p>\r\n', 1, 1),
(663, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Empr&eacute;stimos&quot; do menu principal.</p>\r\n', '<p>\r\n	Sistema exibe tela com campos para inser&ccedil;&atilde;o dos dados do usu&aacute;rio que ir&aacute; realizar o empr&eacute;stimo.</p>\r\n', 1, 1),
(665, 1, '<p>\r\n	Ator seleciona no menu a op&ccedil;&atilde;o &quot;Manter Autor&quot;.</p>\r\n', '<p>\r\n	Sistema exibe uma tela com uma lista de 05 autores cadastrados.</p>\r\n', 1, 1),
(666, 2, '<p>\r\n	Ator pressiona link &quot;Novo Autor&quot;.</p>\r\n', '<p>\r\n	Sistema exibe formul&aacute;rio com campos em branco.</p>\r\n', 1, 1),
(667, 3, '<p>\r\n	Ator deixa o nome do autor em branco e pressiona o bot&atilde;o &quot;Gravar&quot;.</p>\r\n', '<p>\r\n	Sistema exibe a seguinte mensagem de erro &quot;O Nome do Autor deve ser Informado&quot;, com os bot&otilde;es &quot;Cancelar&quot; e &quot;Voltar&quot;.</p>\r\n', 1, 1),
(668, 2, '<p>\r\n	Ator seleciona o livro &quot;Engenharia de Software&quot; atrav&eacute;s do bot&atilde;o &quot;Escolher&quot;</p>\r\n', '<p>\r\n	Sistema exibe tela contendo formul&aacute;rio para ser preenchido com os dados do cliente</p>\r\n', 1, 1),
(669, 2, '<p>\r\n	Ator informa a matricula &quot;20140211678&quot; e o n&uacute;mero do exemplar do item do acervo &quot;123&quot; e pressiona o bot&atilde;o &quot;Realizar Empr&eacute;stimo&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela de confirma&ccedil;&atilde;o contendo o nome do livro &quot;Qualidade de Software&quot; e solicita confirma&ccedil;&atilde;o.</p>\r\n', 1, 1),
(670, 3, '<p>\r\n	Ator pressiona bot&atilde;o &quot;Confirmar&quot;.</p>\r\n', '<p>\r\n	Sistema grava os dados na base de dados e exibe a mensagem &quot;Empr&eacute;stimo Realizado com Sucesso&quot;.</p>\r\n', 1, 1),
(671, 3, '<p>\r\n	Ator peenche os campos do formul&aacute;rio com os valores: N&uacute;mero de Matricula: 1111 e Senha: 0000 e em seguida pressiona o bot&atilde;o &quot;Ok&quot;</p>\r\n', '<p>\r\n	Sistema exibe uma tela de confirma&ccedil;&atilde;o contendo o nome do cliente &quot;Victor Menezes&quot; referente a matr&iacute;cula &quot;1111&quot; durante 3 segundos e finaliza o processo.</p>\r\n', 1, 1),
(672, 1, '<p>\r\n	Ator clica no link Entrar com sua Conta/Registrar-se.</p>\r\n', '<p>\r\n	A tela de autentica&ccedil;&atilde;o deve aparecer.</p>\r\n', 1, 1),
(674, 2, '<p>\r\n	Ator coloca no campo de Nome de usu&aacute;rio com o usu&aacute;rio &quot;carlos&quot; e senha &quot;123456&quot;.</p>\r\n', '<p>\r\n	Uma mensagem deve aparecer &quot;Usu&aacute;rio inv&aacute;lido!&quot;</p>\r\n', 1, 1),
(675, 1, '<p>\r\n	Ator clica no link Entrar com sua Conta/Registrar-se.</p>\r\n', '<p>\r\n	A tela de autentica&ccedil;&atilde;o com Nome de usu&aacute;rio e senha deve aparecer.</p>\r\n', 1, 1),
(676, 2, '<p>\r\n	Ator coloca o Nome de usu&aacute;rio &quot;jessica&quot; e senha &quot;jessica2&quot;.</p>\r\n', '<p>\r\n	O sistema abre e deixa dispon&iacute;veis op&ccedil;&otilde;es de recepcionista.</p>\r\n', 1, 1),
