(678, 2, '<p>\r\n	Ator deixa os campos de Nome de usu&aacute;rio e senha em branco.</p>\r\n', '<p>\r\n	Uma mensagem aparece nos campos com a mensagem campo obrigat&oacute;rio.</p>\r\n', 1, 1),
