(737, 1, '<p>\r\n	Ator acessa a op&ccedil;&atilde;o do menu Conv&ecirc;nio.</p>\r\n', '<p>\r\n	A tela de op&ccedil;&otilde;es de editar, detalhes e remover aparece.</p>\r\n', 1, 1),
(739, 2, '<p>\r\n	Ator clica na op&ccedil;&atilde;o Cadastrar Novo Conv&ecirc;nio.</p>\r\n', '<p>\r\n	Aparece uma tela para preencher os campos do conv&ecirc;nio.</p>\r\n', 1, 1),
(740, 3, '<p>\r\n	Ator insere os dados do conv&ecirc;nio nome: Medic, cnpj: 26789088/90, telefone: 7967853781, email: contato@medic.com.br, endereco: rua rosa, n&ordm; 245, bairro: Cidade Nova, cidade: Aracaju, estado: SE e clica em Cadastrar.</p>\r\n', '<p>\r\n	Aparece a mensagem Conv&ecirc;nio cadastrado com sucesso.</p>\r\n', 1, 1),
(777, 1, '<p>\r\n	Ator seleciona no menu, a op&ccedil;&atilde;o &quot;Consultar Autor&quot;.</p>\r\n', '<p>\r\n	O sistema exibe uma lista com 10 autores que podem ser consultados, que s&atilde;o exibidos de forma alfab&eacute;tica.</p>\r\n', 1, 1),
(778, 2, '<p>\r\n	Ator pressiona link &quot;Consultar Autor&quot;, que se encontra ao lado do autor &quot;Pedro Cunha&quot;.</p>\r\n', '<p>\r\n	Sistema exibe uma tela com os seguintes dados do autor, nome = Pedro Cunha, Data de Nascimento = 28/02/1980 e clica em &quot;Finalizar Consulta&quot;.</p>\r\n', 1, 1),
(779, 1, '<p>\r\n	Ator seleciona a op&ccedil;&atilde;o &quot;Empr&eacute;stimo de Livro&quot; no menu do sistema.</p>\r\n', '<p>\r\n	Sistema exibe uma tela com tr&ecirc;s campos dispon&iacute;veis para pesquisa (Nome Livro, Autor e Editora). Abaixo dos campos de pesquisa, o sistema deve exibir uma lista com 10 livros cadastrados. Abaixo da lista de livros deve conter os bot&otilde;es &quot;Emprestar&quot; e &quot;Cancelar&quot;.</p>\r\n', 1, 1),
(781, 1, '<p>\r\n	Autor clica na op&ccedil;&atilde;o do menu &quot;Emprestar Livro&quot;</p>\r\n', '<p>\r\n	Sistema exibe tela com os campos &quot;Isbn do Livro&quot; e &quot;Cpf&quot; e o Bot&atilde;o &quot;Realizar Emprestimo&quot;</p>\r\n', 1, 1),
(783, 2, '<p>\r\n	Ator n&atilde;o preenche nenhum campo e pressiona o bot&atilde;o &quot;Emprestar&quot;.</p>\r\n', '<p>\r\n	Sistema deve exibir a mensagem de erro &quot;Nenhum livro foi selecionado para empr&eacute;stimo&quot;. Abaixo da mensagem de erro, o sistema deve exibir a op&ccedil;&atilde;o de &quot;Voltar&quot;.</p>\r\n', 1, 1),
(784, 2, '<p>\r\n	Ator informa a matricula &quot;20140211678&quot; e o n&uacute;mero do exemplar do item do acervo &quot;123&quot; e pressiona o bot&atilde;o &quot;Realizar Empr&eacute;stimo&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela de confirma&ccedil;&atilde;o contendo o nome do livro &quot;Qualidade de Software&quot; e solicita confirma&ccedil;&atilde;o.</p>\r\n', 1, 1),
