(786, 4, '<p>\r\n	Autor insere Isbn=&quot;1234&quot;, Cpf=&quot;12345678&quot; e clica no bot&atilde;o &quot;Realizar Emprestimo&quot;</p>\r\n', '<p>\r\n	Sistema exibe mensagem &quot;Empr&eacute;stimo Realizado&quot; e imprime uma nota com:</p>\r\n<p>\r\n	Nome Do Livro: &quot;Qualidade de Software&quot;</p>\r\n<p>\r\n	Nome Da Pessoa: &quot;D&oacute;sea&quot;</p>\r\n<p>\r\n	Data de Empr&eacute;stimo: &quot;10/11/2014&quot;</p>\r\n<p>\r\n	Data de Devolu&ccedil;&atilde;o: &quot;17/11/2014&quot;</p>\r\n', 1, 1),
(787, 1, '<p>\r\n	Autor Clica na op&ccedil;&atilde;o do menu &quot;Realizar Emprestimo&quot;</p>\r\n', '<p>\r\n	Sistema exibe Tela com os campos &quot;Isbn&quot; e &quot;Cpf&quot; e o Bot&atilde;o &quot;Realizar Emprestimo&quot;</p>\r\n', 1, 1),
