(804, 3, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Apagar&quot;.</p>\r\n', '<div>\r\n	O sistema deve exibir um link &quot;Novo&quot; e a lista de todos os condom&iacute;nios cadastrados sem o cond&iacute;minio removido e com os seguintes par&acirc;metros (Nome, Rua, N&uacute;mero, Bairro, Comlemento, CEP, Cidade, Estado e Op&ccedil;&otilde;es).</div>\r\n', 1, 1),
