(811, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Acesso Pessoa&quot; no menu no sistema.</p>\r\n', '<p>\r\n	Sistema deve exibir as op&ccedil;&otilde;es &quot;Registrar Acesso&quot; e &quot;Gerar Relat&oacute;rio&quot;, al&eacute;m de exibir uma lista contendo todos os acessos ao pr&eacute;dio com os par&acirc;metros (Pessoa, CPF, Data e Tipo).</p>\r\n', 1, 1),
(812, 2, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Registrar Acesso&quot;.</p>\r\n', '<p>\r\n	Sistema deve exibir o campo &quot;Pessoa&quot; com os CPFs das pessoas cadastradas e o TIPO (Entrada ou Sa&iacute;da), al&eacute;m das op&ccedil;&otilde;es &quot;Salvar&quot; e &quot;Voltar&quot;.&nbsp;</p>\r\n', 1, 1),
(813, 3, '<p>\r\n	Ator seleciona a PESSOA = 97985417230 e seleciona o TIPO = Entrada. Depois clica em &quot;Salvar&quot;.</p>\r\n', '<p>\r\n	Sistema deve exibir uma lista contendo o novo acesso registrado, com os par&acirc;metros:</p>\r\n<p>\r\n	Nome: Sofia / CPF:&nbsp;97985417230 &nbsp;/ Data: [Data e Hora atual] / Tipo: Entrada.</p>\r\n', 1, 1),
(814, 1, '<div>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Acesso Pessoa&quot; no menu no sistema.</div>\r\n', '<p>\r\n	Sistema deve exibir as op&ccedil;&otilde;es &quot;Registrar Acesso&quot; e &quot;Gerar Relat&oacute;rio&quot;, al&eacute;m de exibir uma lista contendo todos os acessos ao pr&eacute;dio com os par&acirc;metros (Pessoa, CPF, Data e Tipo).</p>\r\n', 1, 1),
(815, 2, '<div>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Registrar Acesso&quot;.</div>\r\n', '<p>\r\n	Sistema deve exibir o campo &quot;Pessoa&quot; com os CPFs das pessoas cadastradas e o TIPO (Entrada ou Sa&iacute;da), al&eacute;m das op&ccedil;&otilde;es &quot;Salvar&quot; e &quot;Voltar&quot;.&nbsp;</p>\r\n', 1, 1),
(816, 3, '<p>\r\n	Ator verifica a exist&ecirc;ncia da PESSOA = 99999999999. Ator percebe que esta pessoa n&atilde;o foi cadastrada.</p>\r\n', '', 1, 1),
