(818, 2, '<div>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Gerar Relat&oacute;rio&quot;.&nbsp;</div>\r\n', '<p>\r\n	Sistema deve exibir uma lista de acesso com &quot;Pessoa&quot;, &quot;CPF&quot;, &quot;Data&quot; e o &quot;TIPO&quot; (Entrada ou Sa&iacute;da) no formato onde pode-se salvar em PDF.</p>\r\n', 1, 1),
