(868, 2, '<p>\r\n	Ator pressiona link &quot;Cadastrar Novo Produto&quot;, localizado na parte inferior, esquerda na tela.</p>\r\n', '<p>\r\n	Sistema exibe formul&aacute;rio com campos em branco.</p>\r\n', 1, 1),
