(874, 2, '<div>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Registrar&quot;.</div>\r\n', '<p>\r\n	Sistema deve exibir o campo &quot;Ve&iacute;culo&quot; com as placas dos carros cadastrados e o TIPO (Entrada ou Sa&iacute;da), al&eacute;m das op&ccedil;&otilde;es &quot;Salvar&quot; e &quot;Voltar&quot;.&nbsp;</p>\r\n', 1, 1),
