(1018, 3, '<div>\r\n	Ator coloca os par&acirc;metros:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Descri&ccedil;&atilde;o = Despesas Administrativas do Grupo de Plano de Contas da Administradora Atlanta do Condom&iacute;nio Residencial Atlanta</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Tipo = Despesa</div>\r\n', '<p>\r\n	Sistema exibe uma mensagem de erro ao lado do campo: &quot;O campo Descri&ccedil;&atilde;o do Grupo de Plano de Contas deve ser uma cadeia de caracteres com um comprimento m&aacute;ximo de 100.&quot;</p>\r\n', 1, 1),
(1019, 1, '<p>\r\n	Ator clica no bot&atilde;o &quot;Cadastros&quot;.</p>\r\n', '<p>\r\n	Sistema exibe uma tela com os links &quot;Exame&quot;, &quot;Especialidade&quot; e &quot;Categoria da Consulta&quot;.</p>\r\n', 1, 1),
