(1410, 4, '<p>\r\n	Ator pressiona bot&atilde;o &quot;Finalizar Escolha&quot;.</p>\r\n', '<p>\r\n	Sistema exibe mensagem de erro, &quot;Nenhuma imagem foi escolhida, por favor escolha uma imagem.&quot;. Abaixo da mensagem de erro, o sistema deve exibir o bot&atilde;o &quot;Voltar&quot;.</p>\r\n', 1, 1),
