(1613, 2, '<p>\r\n	Ator realiza as seguintes a&ccedil;&otilde;es:</p>\r\n<ul>\r\n	<li>\r\n		Seleciona o servi&ccedil;o &quot;Maquiagem&quot; e pressiona o bot&atilde;o &quot;Adicionar&quot;, localizado abaixo do &quot;combo box&quot; referente &agrave; servi&ccedil;os;</li>\r\n	<li>\r\n		Seleciona o produto &quot;Fotolivro&quot; e pressiona o bot&atilde;o &quot;Adicionar&quot;, localizado abaixo do &quot;combo box&quot; referente &agrave; produtos;</li>\r\n	<li>\r\n		Seleciona o tipo de evento &quot;Casamento&quot; e pressiona o bot&atilde;o &quot;Adicionar&quot;, localizado abaixo do &quot;combo box&quot; referente &agrave; tipos de evento.</li>\r\n</ul>\r\n', '<p>\r\n	A lista referente &agrave; servi&ccedil;os, &eacute; preenchida com o servi&ccedil;o cujo nome &eacute; &quot;Maquiagem&quot;.</p>\r\n<p>\r\n	A lista referente &agrave; produtos, &eacute; preenchida com o produto cujo nome &eacute; &quot;Fotolivro&quot;.</p>\r\n<p>\r\n	A lista referente &agrave; tipos de evento, &eacute; preenchida com o tipo de evento cujo nome &eacute; &quot;Casamento&quot;.</p>\r\n', 1, 1),
(1614, 3, '<p>\r\n	Ator pressiona o bot&atilde;o &quot;Salvar Or&ccedil;amento&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela com um formul&aacute;rio contendo s campos: &quot;Nome do Or&ccedil;amento&quot; e &quot;Nome do Cliente&quot;, al&eacute;m dos bot&otilde;es &quot;Salvar&quot; e &quot;Voltar&quot;.</p>\r\n', 1, 1),
(1615, 1, '<p>\r\n	Ator seleciona no menu a op&ccedil;&atilde;o &quot;Or&ccedil;amento&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela contendo os seguinte itens:</p>\r\n<ul>\r\n	<li>\r\n		Tr&ecirc;s &quot;combo box&quot;, cada um contendo, respectivamente, todos os servi&ccedil;os, produtos e tipos de evento previamente cadastrados;</li>\r\n	<li>\r\n		Tr&ecirc;s bot&otilde;es &quot;Adicionar&quot;;</li>\r\n	<li>\r\n		Tr&ecirc;s listas, referentes aos servi&ccedil;os, produtos e tipos de evento que ser&atilde;o adicionados ao or&ccedil;amento;</li>\r\n	<li>\r\n		Os bot&otilde;es &quot;Salvar Or&ccedil;amento&quot; e &quot;Limpar Campos&quot;.</li>\r\n</ul>\r\n', 1, 1),
(1616, 2, '<p>\r\n	Ator realiza as seguintes a&ccedil;&otilde;es:</p>\r\n<ul>\r\n	<li>\r\n		Seleciona o servi&ccedil;o &quot;Maquiagem&quot; e pressiona o bot&atilde;o &quot;Adicionar&quot;, localizado abaixo do &quot;combo box&quot; referente &agrave; servi&ccedil;os;</li>\r\n	<li>\r\n		Seleciona o produto &quot;Fotolivro&quot; e pressiona o bot&atilde;o &quot;Adicionar&quot;, localizado abaixo do &quot;combo box&quot; referente &agrave; produtos;</li>\r\n	<li>\r\n		N&atilde;o seleciona nenhum tipo de evento.</li>\r\n</ul>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n', '<p>\r\n	A lista referente &agrave; servi&ccedil;os, &eacute; preenchida com o servi&ccedil;o cujo nome &eacute; &quot;Maquiagem&quot;.<br />\r\n	<br />\r\n	A lista referente &agrave; produtos, &eacute; preenchida com o produto cujo nome &eacute; &quot;Fotolivro&quot;.<br />\r\n	&nbsp;</p>\r\n', 1, 1),
(1620, 1, '<p>\r\n	Ator seleciona no menu a op&ccedil;&atilde;o &quot;Cliente&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela com lista de todos os clientes previamente cadastrados.</p>\r\n', 1, 1),
(1621, 2, '<div>\r\n	Ator clica na palavra &quot;Or&ccedil;amentos&quot;, localizado &agrave; direita da lista de clientes, referente a linha cujo&nbsp;</div>\r\n<div>\r\n	nome do cliente &eacute; &quot;Pedro&quot; e o E-Mail &eacute; &quot;pedro@gmail.com&quot;.</div>\r\n', '<p>\r\n	Sistema exibe tela com lista de todos os or&ccedil;amentos previamente cadastrados, pertencentes ao cliente &quot;Pedro&quot;.</p>\r\n', 1, 1),
(1622, 3, '<div>\r\n	Ator clica na palavra &quot;Remover&quot;, localizado &agrave; direita da lista de or&ccedil;amentos de &quot;Pedro&quot;, referente a linha cujo&nbsp;</div>\r\n<div>\r\n	nome do or&ccedil;amento &eacute; &quot;Casamento de Maria e Pedro&quot;.</div>\r\n', '<div>\r\n	O sistema deve exibir um formul&aacute;rio preenchido com os seguintes dados:</div>\r\n<div>\r\n	Nome do Or&ccedil;amento = &quot;Casamento de Maria e Pedro&quot;;</div>\r\n<div>\r\n	Data de cria&ccedil;&atilde;o = &quot;20/06/2014&quot;;</div>\r\n<div>\r\n	Valor = &quot;2.000&quot;;</div>\r\n<div>\r\n	Data de Emiss&atilde;o = &quot;20/06/2014&quot;;</div>\r\n<div>\r\n	Nome do Cliente = &quot;Pedro&quot;.</div>\r\n<div>\r\n	e os bot&otilde;es &quot;Remover&quot; e &quot;Voltar&quot; na parte inferior da p&aacute;gina.</div>\r\n', 1, 1),
(1623, 4, '<p>\r\n	Ator pressiona o bot&atilde;o &quot;Remover&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela inicial do menu &quot;Cliente&quot;.</p>\r\n', 1, 1);
INSERT INTO `tcsteps` (`id`, `step_number`, `actions`, `expected_results`, `active`, `execution_type`) VALUES
(1629, 1, '<p>\r\n	Ator seleciona no menu a op&ccedil;&atilde;o &quot;Cliente&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela com lista de todos os clientes previamente cadastrados.</p>\r\n', 1, 1),
(1630, 2, '<div>\r\n	Ator clica na palavra &quot;Or&ccedil;amentos&quot;, localizado &agrave; direita da lista de clientes, referente a linha cujo&nbsp;</div>\r\n<div>\r\n	nome do cliente &eacute; &quot;Pedro&quot; e o E-Mail &eacute; &quot;pedro@gmail.com&quot;.</div>\r\n', '<p>\r\n	Sistema exibe tela com lista de todos os or&ccedil;amentos previamente cadastrados, pertencentes ao cliente &quot;Pedro&quot;.</p>\r\n', 1, 1),
(1631, 3, '<div>\r\n	Ator clica na palavra &quot;Detalhes&quot;, localizado &agrave; direita da lista de or&ccedil;amentos de &quot;Pedro&quot;, referente a linha cujo&nbsp;</div>\r\n<div>\r\n	nome do or&ccedil;amento &eacute; &quot;Casamento de Maria e Pedro&quot;.</div>\r\n', '<p>\r\n	O sistema deve exibir uma tela com as listas de produtos, servi&ccedil;os e tipos de eventos pertencentes ao or&ccedil;amento. E um bot&atilde;o &quot;Voltar&quot;.</p>\r\n<p>\r\n	A lista de produtos deve conter o produto &quot;Fotolivro&quot;.</p>\r\n<p>\r\n	A lista de servi&ccedil;os deve conter o servi&ccedil;o &quot;Maquiagem&quot;.</p>\r\n<p>\r\n	A lista de tipos de evento deve conter o tipo de evento &quot;Casamento&quot;.</p>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1637, 1, '<p>\r\n	Ator clica no bot&atilde;o &quot;Finalizar Exames&quot;.</p>\r\n', '<p>\r\n	Sistema exibe 05 exames que est&atilde;o sendo realizados e tamb&eacute;m exibe na parte superior esquerda da tela o link &quot;Sem Resultados Cadastrados&quot;.</p>\r\n', 1, 1),
(1638, 2, '<p>\r\n	Ator clica no link &quot;Sem Resultados Cadastrados&quot;.</p>\r\n', '<p>\r\n	Sistema exibe 05 exames que est&atilde;o ainda est&atilde;o sem resultados cadastrados.</p>\r\n', 1, 1),
(1639, 3, '<div>\r\n	Ator clica no link &quot;Cadastrar Resultado&quot;, que fica ao lado esquerdo do exame que cont&eacute;m os seguintes dados:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;* Paciente: &quot;Roberto&quot;;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;* Exame: &quot;Raio-X&quot;;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;* Data de Realiza&ccedil;&atilde;o: &quot;13/11/2014 00:00:00&quot;.</div>\r\n', '<div>\r\n	Sistema exibe tela com os seguintes campos:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;* Status do Exame - Setado com o valor &quot;Finalizado&quot;.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;* Resultado - Ainda sem dados cadastrados;</div>\r\n', 1, 1),
(1640, 4, '<p>\r\n	Ator seleciona o Status do Exame &quot;Resultado Dispon&iacute;vel&quot; e adiciona um resultado do exame que &eacute; maior que 30MB. Feito isso, clica no bot&atilde;o &quot;Cadastrar Resultado&quot;.</p>\r\n', '<p>\r\n	Sistema exibe uma mensagem, informando &quot;Tamanho do Arquivo N&atilde;o Suportado!&quot; e exibe o bot&atilde;o &quot;Voltar&quot;, para que o usu&aacute;rio possa novamente inserir o exame.</p>\r\n', 1, 1),
(1644, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Postagens&quot; no menu do sistema.</p>\r\n', '<p>\r\n	O sistema deve exibir dois links um &quot;Novo&quot; e um &quot;Minhas Postagens&quot; e a lista de todas as postagens cadastradas com os seguintes par&acirc;metros (Nome da Pessoa, T&iacute;tulo, Descri&ccedil;&atilde;o, Data de In&iacute;cio, Data de Finaliza&ccedil;&atilde;o e Op&ccedil;&otilde;es).</p>\r\n', 1, 1),
(1645, 2, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Visualizar Coment&aacute;rios&quot; referente a postagem Nome da Pessoa=&quot;M&aacute;rio&quot; e T&iacute;tulo=&quot;Manuten&ccedil;&atilde;o Elevador&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela de Coment&aacute;rios com os seguintes dados:</p>\r\n<div>\r\n	Postagem:</div>\r\n<div>\r\n	Nome da Pessoa=&quot;M&aacute;rio&quot; e T&iacute;tulo da Postagem=&quot;Manuten&ccedil;&atilde;o Elevador&quot;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Comentarios: Links &quot;Novo&quot;, &quot;Meus Coment&aacute;rios&quot; e &quot;Voltar&quot; e lista de todos os coment&aacute;rios com os seguintes par&acirc;metros (Nome da Pessoa, Coment&aacute;rio, Data e Op&ccedil;&otilde;es).</div>\r\n', 1, 1),
(1646, 3, '<p>\r\n	Ator verifica se &eacute; exibida a op&ccedil;&atilde;o link &quot;Apagar&quot; referente a postagem com:</p>\r\n<p>\r\n	Nome da Pessoa=&quot;M&aacute;rio&quot; / Coment&aacute;rio=&quot;Quanto custa&quot;.</p>\r\n<p>\r\n	Link n&atilde;o &eacute; encontrado.</p>\r\n', '<p>\r\n	Sistema permanece sem nehuma altera&ccedil;&atilde;o.</p>\r\n', 1, 1),
(1647, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Postagens&quot; no menu do sistema.</p>\r\n', '<p>\r\n	O sistema deve exibir dois links um &quot;Novo&quot; e um &quot;Minhas Postagens&quot; e a lista de todas as postagens cadastradas com os seguintes par&acirc;metros (Nome da Pessoa, T&iacute;tulo, Descri&ccedil;&atilde;o, Data de In&iacute;cio, Data de Finaliza&ccedil;&atilde;o e Op&ccedil;&otilde;es).</p>\r\n', 1, 1),
(1648, 2, '<p>\r\n	Ator clica no link &quot;Minhas Postagens&quot;&nbsp;</p>\r\n', '<p>\r\n	O sistema deve exibir dois links um &quot;Novo&quot; e um &quot;Minhas Postagens&quot; e a lista de todas as postagens do usuario logado, com os seguintes par&acirc;metros (Nome da Pessoa, T&iacute;tulo, Descri&ccedil;&atilde;o, Data de In&iacute;cio, Data de Finaliza&ccedil;&atilde;o e Op&ccedil;&otilde;es).</p>\r\n', 1, 1),
(1649, 3, '<p>\r\n	Ator verifica se todas as postagens exibidas tem o Nome da Pessoa=&quot;M&aacute;rio&quot;</p>\r\n', '', 1, 1),
(1650, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Postagens&quot; no menu do sistema.</p>\r\n', '<p>\r\n	O sistema deve exibir dois links um &quot;Novo&quot; e um &quot;Minhas Postagens&quot; e a lista de todas as postagens cadastradas com os seguintes par&acirc;metros (Nome da Pessoa, T&iacute;tulo, Descri&ccedil;&atilde;o, Data de In&iacute;cio, Data de Finaliza&ccedil;&atilde;o e Op&ccedil;&otilde;es).</p>\r\n', 1, 1),
(1651, 2, '<p>\r\n	Ator clica na op&ccedil;&atilde;o &quot;Visualizar Coment&aacute;rios&quot; referente a postagem Nome da Pessoa=&quot;M&aacute;rio&quot; e T&iacute;tulo=&quot;Manuten&ccedil;&atilde;o Elevador&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela de Coment&aacute;rios com os seguintes dados:</p>\r\n<div>\r\n	Postagem:</div>\r\n<div>\r\n	Nome da Pessoa=&quot;M&aacute;rio&quot; e T&iacute;tulo da Postagem=&quot;Manuten&ccedil;&atilde;o Elevador&quot;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Comentarios: Links &quot;Novo&quot;, &quot;Meus Coment&aacute;rios&quot; e &quot;Voltar&quot; e lista de todos os coment&aacute;rios com os seguintes par&acirc;metros (Nome da Pessoa, Coment&aacute;rio, Data e Op&ccedil;&otilde;es).</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1652, 3, '<p>\r\n	Ator clica no link no link &quot;Meus Coment&aacute;rios&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela de Coment&aacute;rios com os seguintes dados:</p>\r\n<div>\r\n	Postagem:</div>\r\n<div>\r\n	Nome da Pessoa=&quot;M&aacute;rio&quot; e T&iacute;tulo da Postagem=&quot;Manuten&ccedil;&atilde;o Elevador&quot;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Comentarios: Links &quot;Novo&quot;, &quot;Meus Coment&aacute;rios&quot; e &quot;Voltar&quot; e lista de todos os coment&aacute;rios feitos pelo usu&aacute;rio logado com os seguintes par&acirc;metros (Nome da Pessoa, Coment&aacute;rio, Data e Op&ccedil;&otilde;es).</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1653, 4, '<p>\r\n	Ator verifica se todos os coment&aacute;rios exibidos tem o Nome da Pessoa=&quot;M&aacute;rio&quot;.</p>\r\n', '', 1, 1),
(1654, 4, '<p>\r\n	Ator preenche o campo &quot;Nome do Or&ccedil;amento&quot; com o valor &quot;Casamento de Maria e Pedro&quot;. No campo &quot;Nome do Cliente&quot;, o ator seleciona o cliente &quot;Pedro&quot;. E Em seguida pressiona o bot&atilde;o &quot;Salvar&quot;.</p>\r\n', '<p>\r\n	Sistema volta para tela inicial do menu &quot;Or&ccedil;amento&quot;.</p>\r\n', 1, 1),
(1655, 3, '<p>\r\n	Ator clica no bot&atilde;o &quot;Salvar Or&ccedil;amento&quot;</p>\r\n', '<p>\r\n	Sistema exibe mensagem &quot;O campo Tipo de Evento &eacute; requerido&quot;, ao lado no combobox referente &agrave; tipos de evento.</p>\r\n', 1, 1),
(1700, 1, '<p>\r\n	Ator clina na op&ccedil;&atilde;o do menu Paciente -&gt; Relato Cl&iacute;nico</p>\r\n', '<p>\r\n	Sistema exibe a tela de relato cl&iacute;nico que cont&eacute;m:&nbsp;</p>\r\n<p>\r\n	Lista com os par&acirc;metros Relato Cl&iacute;nico, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Ar&eacute;a de Atua&ccedil;&atilde;o, Editar, Detalhes, Remover e Atribuir;</p>\r\n<p>\r\n	Link &quot;Criar&quot;;</p>\r\n<p>\r\n	Um combobox com a op&ccedil;&atilde;o &quot;Listar Todos&quot; selecionada;</p>\r\n<p>\r\n	Uma area para apresentar a imagem do paciente.</p>\r\n', 1, 1),
(1701, 2, '<p>\r\n	Ator clica no combobox e selecionao paciente=&quot;J.J.&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela de relato cl&iacute;nico que cont&eacute;m:&nbsp;</p>\r\n<p>\r\n	Lista com os par&acirc;metros Relato Cl&iacute;nico, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Ar&eacute;a de Atua&ccedil;&atilde;o, Editar, Detalhes, Remover e Atribuir;</p>\r\n<p>\r\n	Link &quot;Criar&quot;;</p>\r\n<p>\r\n	Um combobox com a op&ccedil;&atilde;o &quot;J.J.&quot; selecionada;</p>\r\n<p>\r\n	Uma area com a imagem do paciente &quot;J.J.&quot; selecionada.</p>\r\n', 1, 1),
(1702, 3, '<p>\r\n	Ator clica no Link=&quot;Atribuir&quot; da seguinte linha:</p>\r\n<p>\r\n	Relato clinico=&quot;J.J.&quot;, Ordem Cronol&oacute;gica=&quot;1&quot; , N&iacute;vel de Dificuldade=&quot;1&quot;, Ar&eacute;a de Atua&ccedil;&atilde;o=&quot;Sa&uacute;de P&uacute;blica&quot;.</p>\r\n', '<p>\r\n	Sistema exibe tela Atribuir que cont&eacute;m:</p>\r\n<p>\r\n	Lista com os par&acirc;metros Nome da Pessoa, Perfil e Atribuir;</p>\r\n<p>\r\n	Labels especificando Nome do Paciente=&quot;J.J.&quot; e Ordem Cronol&oacute;gica=&quot;1&quot;.</p>\r\n', 1, 1),
(1703, 4, '<p>\r\n	Ator clica no link=&quot;Atribuir&quot; da seguinte linha:</p>\r\n<p>\r\n	Nome da Pessoa=&quot;Aluno teste&quot; e Perfil=&quot;usuario&quot;</p>\r\n', '<p>\r\n	Sistema exibe um alert com a mensagem &quot;O paciente foi atribu&iacute;do a consulta.&quot; e retorna para a tela de Relato Cl&iacute;nico.</p>\r\n', 1, 1),
(1744, 1, '<p>\r\n	Clicar no Menu Consultas &gt; Consulta</p>\r\n', '<p>\r\n	Exibe uma lista de todas as consultas destinadas a este usu&aacute;rio.</p>\r\n', 1, 1),
(1745, 2, '<p>\r\n	Listar as consultas do Paciente J.J.</p>\r\n', '<p>\r\n	Exibe todas as consultas deste paciente.</p>\r\n', 1, 1),
(1746, 3, '<p>\r\n	Clicar em Preencher a consulta de ordem cronol&oacute;gica 1.</p>\r\n', '<p>\r\n	Exibe os dados da consulta.</p>\r\n', 1, 1),
(1747, 4, '<p>\r\n	Clicar no bot&atilde;o &quot;Encerrar Consulta&quot; e confirmar a a&ccedil;&atilde;o.</p>\r\n', '<p>\r\n	Sistema n&atilde;o exibe nenhuma confirma&ccedil;&atilde;o e redireciona para a lista de consultas destinadas a este usu&aacute;rio.</p>\r\n', 1, 1),
(1748, 1, '<p>\r\n	Clicar no Menu Consultas &gt; Corrigir Consultas</p>\r\n', '<p>\r\n	Sistema exibe uma lista com as consultas enviadas para a corre&ccedil;&atilde;o por um Tutor.</p>\r\n', 1, 1),
(1749, 2, '<p>\r\n	Clicar no link &quot;Corrigir&quot; para o paciente J.J. de oredem cronol&oacute;gica 1 com status de &quot;Enviado para Corre&ccedil;&atilde;o&quot;.</p>\r\n', '<p>\r\n	Sistema exibe a consulta com os dados preenchidos pelo aluno.</p>\r\n', 1, 1),
(1750, 3, '<p>\r\n	Verifica as corre&ccedil;&otilde;es autom&aacute;ticas feitas pelo sistema.</p>\r\n<p>\r\n	Se necess&aacute;rio Adiciona um coment&aacute;rio e clica no bot&atilde;o &quot;Salvar&quot; localizado logo abaixo a descri&ccedil;&atilde;o do coment&aacute;rio.</p>\r\n<p>\r\n	Ao final, clica no bot&atilde;o &quot;Finalizar Corre&ccedil;&atilde;o&quot; e confirma a a&ccedil;&atilde;o.</p>\r\n', '<p>\r\n	Sistema volta a exibir uma lista de consultas enviadas para a corre&ccedil;&atilde;o.</p>\r\n', 1, 1),
(1751, 1, '<p>\r\n	Ator clina na op&ccedil;&atilde;o do menu Paciente -&gt; Relato Cl&iacute;nico</p>\r\n', '<p>\r\n	Sistema exibe a tela de relato cl&iacute;nico que cont&eacute;m:&nbsp;</p>\r\n<p>\r\n	Lista com os par&acirc;metros Relato Cl&iacute;nico, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Ar&eacute;a de Atua&ccedil;&atilde;o, Editar, Detalhes, Remover e Atribuir;</p>\r\n<p>\r\n	Link &quot;Criar&quot;;</p>\r\n<p>\r\n	Um combobox com a op&ccedil;&atilde;o &quot;Listar Todos&quot; selecionada;</p>\r\n<p>\r\n	Uma area para apresentar a imagem do paciente.</p>\r\n', 1, 1),
(1752, 2, '<p>\r\n	Ator clica no combobox e selecionao paciente=&quot;J.J.&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela de relato cl&iacute;nico que cont&eacute;m:&nbsp;</p>\r\n<p>\r\n	Lista com os par&acirc;metros Relato Cl&iacute;nico, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Ar&eacute;a de Atua&ccedil;&atilde;o, Editar, Detalhes, Remover e Atribuir;</p>\r\n<p>\r\n	Link &quot;Criar&quot;;</p>\r\n<p>\r\n	Um combobox com a op&ccedil;&atilde;o &quot;J.J.&quot; selecionada;</p>\r\n<p>\r\n	Uma area com a imagem do paciente &quot;J.J.&quot; selecionada.</p>\r\n', 1, 1),
(1753, 3, '<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Ator clica no Link=&quot;Atribuir&quot; da seguinte linha:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Relato clinico=&quot;J.J.&quot;, Ordem Cronol&oacute;gica=&quot;2&quot; , N&iacute;vel de Dificuldade=&quot;1&quot;, Ar&eacute;a de Atua&ccedil;&atilde;o=&quot;Sa&uacute;de P&uacute;blica&quot;.</div>\r\n', '<p>\r\n	Sistema exibe tela Atribuir que cont&eacute;m:</p>\r\n<p>\r\n	Lista com os par&acirc;metros Nome da Pessoa, Perfil e Atribuir;</p>\r\n<p>\r\n	Labels especificando Nome do Paciente=&quot;J.J.&quot; e Ordem Cronol&oacute;gica=&quot;2&quot;.</p>\r\n', 1, 1),
(1754, 4, '<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Ator clica no link=&quot;Atribuir&quot; da seguinte linha:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Nome da Pessoa=&quot;Aluno teste&quot; e Perfil=&quot;usuario&quot;</div>\r\n', '<p>\r\n	Sistema exibe um alert com a mensagem &quot;O paciente foi atribu&iacute;do a consulta.&quot; e retorna para a tela de Relato Cl&iacute;nico.</p>\r\n', 1, 1),
