(1811, 3, '<div>\r\n	Ator clica no Link=&quot;Atribuir&quot; da seguinte linha:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	Relato clinico=&quot;J.J.&quot;, Ordem Cronol&oacute;gica=&quot;4&quot; , N&iacute;vel de Dificuldade=&quot;1&quot;, Ar&eacute;a de Atua&ccedil;&atilde;o=&quot;Sa&uacute;de P&uacute;blica&quot;.</div>\r\n<div>\r\n	Sistema exibe tela Atribuir que cont&eacute;m:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Lista com os par&acirc;metros Nome da Pessoa, Perfil e Atribuir;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Labels especificando Nome do Paciente=&quot;J.J.&quot; e Ordem Cronol&oacute;gica=&quot;4&quot;.</div>\r\n', 1, 1),
(1812, 4, '<div>\r\n	Ator clica no link=&quot;Atribuir&quot; da seguinte linha:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	Nome da Pessoa=&quot;Aluno teste&quot; e Perfil=&quot;usuario&quot;</div>\r\n<div>\r\n	Sistema exibe um alert com a mensagem &quot;O paciente foi atribu&iacute;do a consulta.&quot; e retorna para a tela de Relato Cl&iacute;nico.</div>\r\n', 1, 1);
INSERT INTO `tcsteps` (`id`, `step_number`, `actions`, `expected_results`, `active`, `execution_type`) VALUES
(1813, 1, '<div>\r\n	Clicar no Menu Consultas &gt; Consulta</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<p>\r\n	Exibe uma lista de todas as consultas destinadas a este usu&aacute;rio.</p>\r\n', 1, 1),
(1814, 2, '<div>\r\n	Listar as consultas do Paciente J.J.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	Exibe todas as consultas deste paciente.</div>\r\n<div>\r\n	Remover passo<span class="Apple-tab-span" style="white-space: pre;"> </span>Inserir Passo</div>\r\n', 1, 1),
(1815, 3, '<div>\r\n	Clicar em Preencher na consulta de ordem cronol&oacute;gica 4.</div>\r\n', '<p>\r\n	Exibe a consulta completa com os dados da consulta anterior cadastrados anteriormente.</p>\r\n', 1, 1),
(1816, 4, '<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Clica no bot&atilde;o &quot;Pr&oacute;ximo&quot; localizado abaixo da consulta.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<p>\r\n	Sistema exibe as abas destinadas a segunda parte da consulta com os dados preenchidos anteriormente.</p>\r\n', 1, 1),
(1817, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o do menu Consultas -&gt; consulta.</p>\r\n', '<p>\r\n	Sistema exibe a tela de consulta que cont&eacute;m:</p>\r\n<p>\r\n	Lista com os par&acirc;metros Paciente, Usu&aacute;rio, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Status do Preechimento, Turma e Op&ccedil;&otilde;es;</p>\r\n<p>\r\n	Um com combo com a op&ccedil;&atilde;o &quot;Listar Todos&quot; selecionada;</p>\r\n<p>\r\n	Uma &aacute;rea para apresentar a imagem do paciente.</p>\r\n', 1, 1),
(1818, 2, '<p>\r\n	Ator clica no combobox e seleciona a op&ccedil;&atilde;o=&quot;J.J.&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela de consulta que cont&eacute;m:</p>\r\n<p>\r\n	Lista com os par&acirc;metros Paciente, Usu&aacute;rio, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Status do Preechimento, Turma e Op&ccedil;&otilde;es;</p>\r\n<p>\r\n	Um com combo com a op&ccedil;&atilde;o &quot;J.J.&quot; selecionada;</p>\r\n<p>\r\n	Uma &aacute;rea com a imagem do paciente &quot;J.J.&quot; selecionada.</p>\r\n', 1, 1),
(1819, 5, '<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Clina na aba &quot;Di&aacute;rio Pessoal de Medicamentos&quot;.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<p>\r\n	Sistema exibe os dados destinados ao preenchimento desta aba.</p>\r\n', 1, 1),
(1820, 3, '<p>\r\n	Ator clica no Link=&quot;Atribuir&quot; da seguinte linha:</p>\r\n<p>\r\n	Paciente=&quot;J.J.&quot;, Usu&aacute;rio=&quot;Aluno teste&quot;, Ordem Cronol&oacute;gica=&quot;1&quot;, N&iacute;vel de Dificuldade=&quot;1&quot;, Status do Preenchimento=&quot;Em Preenchimento&quot; e Turma=&quot;DFA0037&quot;.</p>\r\n', '<p>\r\n	Sistema exibe a tela de Preenchimento da consulta que cont&eacute;m:</p>\r\n<p>\r\n	Ar&eacute;a com o relato do paciente com Nome do Paciente=&quot;J.J.&quot;, imagem do paciente e Relato em Texto;</p>\r\n<p>\r\n	Ar&eacute;a com Coment&aacute;rios do Tutor desabilitada Descri&ccedil;&atilde;o=&quot;&quot;;</p>\r\n<p>\r\n	Ar&eacute;a com conjunto de abas: Dados Demogr&aacute;ficos e Antropom&eacute;tricos (selecionada), Raz&atilde;o do Encontro, Experi&ecirc;ncia com Medicamentos, Estilo de Vida, Alergia, Medicamentos Prescritos, Medicamentos n&atilde;o Prescritos, Medicamentos Anteiores, Hist&oacute;ria do Paciente, Exames F&iacute;sicos, Par&ecirc;metro Cl&iacute;nico, Revis&atilde;o dos Sistemas e Links &Uacute;teis;</p>\r\n<p>\r\n	Bot&otilde;es Voltar, Pr&oacute;ximo e Encerrar Consulta.</p>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1821, 4, '<p>\r\n	Ator clica na aba Revis&atilde;o dos Sistemas.</p>\r\n', '<p>\r\n	Sistema permanece na tela de Preenchimento da consulta, com a aba Revis&atilde;o dos Sistemas selecionada com os seguintes dados:</p>\r\n<p>\r\n	Nome do Sistema=&quot;Selecione&quot;, Altermativas de Interven&ccedil;&atilde;o=&quot;Selecione&quot;;</p>\r\n<p>\r\n	Lista Problema de Sa&uacute;de com os par&acirc;metros Problema de Sa&uacute;de e Op&ccedil;&otilde;es. N&atilde;o cont&eacute;m nenhuma linha adicionada.</p>\r\n<p>\r\n	Bot&atilde;o Adicionar.</p>\r\n', 1, 1),
(1822, 6, '<p>\r\n	Usu&aacute;rio preenche os dados da seguinte forma:</p>\r\n<div>\r\n	Medicamento: Metformina</div>\r\n<div>\r\n	Dose: 850 mg</div>\r\n<div>\r\n	Quantidade: 1 comprimido</div>\r\n<div>\r\n	Per&iacute;odo: Tarde</div>\r\n<div>\r\n	Hor&aacute;rio: 12:30</div>\r\n<div>\r\n	Hor&aacute;rio Observa&ccedil;&atilde;o: Deixar este campo em branco</div>\r\n<div>\r\n	Tipo de Bebida: &Aacute;gua</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Clicar no bot&atilde;o &quot;Adicionar&quot;.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<p>\r\n	Sistema n&atilde;o exibe mensagem de confirma&ccedil;&atilde;o.</p>\r\n<p>\r\n	Sistema atualiza a lista de medicamentos com o novo medicamento adicionado.</p>\r\n', 1, 1),
(1823, 5, '<p>\r\n	Ator preenche os campos da aba Revis&atilde;o dos Sistemas da seguinte forma:</p>\r\n<p>\r\n	Nome do Sistema=&quot;Pulmonar&quot;, Alternativas de Interven&ccedil;&atilde;o=&quot;Falta de Ar&quot;;</p>\r\n<p>\r\n	e clica no bot&atilde;o=&quot;Adicionar&quot;</p>\r\n', '<p>\r\n	Sistema permanece na tela de Preenchimento da consulta, com a aba Revis&atilde;o dos Sistemas selecionada com os seguintes dados:</p>\r\n<p>\r\n	Nome do Sistema=&quot;Selecione&quot;, Altermativas de Interven&ccedil;&atilde;o=&quot;Selecione&quot;;</p>\r\n<p>\r\n	Lista Problema de Sa&uacute;de com os par&acirc;metros Problema de Sa&uacute;de e Op&ccedil;&otilde;es. Cont&eacute;m a linha: Problema de Sa&uacute;de=&quot;Falta de Ar&quot; e Op&ccedil;&otilde;es=&quot;Remover&quot;.</p>\r\n', 1, 1),
(1824, 1, '<div>\r\n	Usu&aacute;rio preenche os dados da seguinte forma:</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Medicamento: Metformina</div>\r\n<div>\r\n	Dose: 850 mg</div>\r\n<div>\r\n	Quantidade: Deixar este campo em branco</div>\r\n<div>\r\n	Per&iacute;odo: N&atilde;o selecionar nenhuma op&ccedil;&atilde;o</div>\r\n<div>\r\n	Hor&aacute;rio: Deixar este campo em branco</div>\r\n<div>\r\n	Hor&aacute;rio Observa&ccedil;&atilde;o: Deixar este campo em branco</div>\r\n<div>\r\n	Tipo de Bebida: &Aacute;gua</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Clicar no bot&atilde;o &quot;Adicionar&quot;.</div>\r\n', '<div>\r\n	Sistema exibe mensagens de erro para o seguintes campos: &quot;Quantidade&quot;, &quot;Per&iacute;odo&quot; e &quot;Hor&aacute;rio&quot;.&nbsp;Com a seguinte mensagem: *O campo (Nome do Campo) &eacute; obrigat&oacute;rio.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Sistema n&atilde;o atualiza a lista de medicamentos.</div>\r\n', 1, 1),
(1825, 1, '<div>\r\n	Clicar no Menu Consultas &gt; Consulta</div>\r\n', '<div>\r\n	Exibe uma lista de todas as consultas destinadas a este usu&aacute;rio.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1826, 2, '<div>\r\n	Listar as consultas do Paciente J.J.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	Exibe todas as consultas deste paciente.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1827, 3, '<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Clicar em Preencher a consulta de ordem cronol&oacute;gica 4.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	<div>\r\n		&nbsp;</div>\r\n	<div>\r\n		Exibe os dados da consulta..</div>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1828, 4, '<div>\r\n	Clicar no bot&atilde;o &quot;Encerrar Consulta&quot; e confirmar a a&ccedil;&atilde;o.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	Sistema n&atilde;o exibe nenhuma confirma&ccedil;&atilde;o e redireciona para a lista de consultas destinadas a este usu&aacute;rio.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1829, 1, '<div>\r\n	Clicar no Menu Consultas &gt; Corrigir Consultas</div>\r\n', '<div>\r\n	Sistema exibe uma lista com as consultas enviadas para a corre&ccedil;&atilde;o por um Tutor.</div>\r\n', 1, 1),
(1830, 2, '<div>\r\n	Clicar no link &quot;Corrigir&quot; para o paciente J.J. de oredem cronol&oacute;gica 2 com status de &quot;Enviado para Corre&ccedil;&atilde;o&quot;.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	Sistema exibe a consulta com os dados preenchidos pelo aluno.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1831, 3, '<div>\r\n	Verifica as corre&ccedil;&otilde;es autom&aacute;ticas feitas pelo sistema.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Se necess&aacute;rio Adiciona um coment&aacute;rio e clica no bot&atilde;o &quot;Salvar&quot; localizado logo abaixo a descri&ccedil;&atilde;o do coment&aacute;rio.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Ao final, clica no bot&atilde;o &quot;Finalizar Corre&ccedil;&atilde;o&quot; e confirma a a&ccedil;&atilde;o.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', '<div>\r\n	Sistema volta a exibir uma lista de consultas enviadas para a corre&ccedil;&atilde;o.</div>\r\n<div>\r\n	&nbsp;</div>\r\n', 1, 1),
(1832, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o do menu Consultas -&gt; consulta.</p>\r\n', '<p>\r\n	Sistema exibe a tela de consulta que cont&eacute;m:</p>\r\n<p>\r\n	Lista com os par&acirc;metros Paciente, Usu&aacute;rio, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Status do Preechimento, Turma e Op&ccedil;&otilde;es;</p>\r\n<p>\r\n	Um com combo com a op&ccedil;&atilde;o &quot;Listar Todos&quot; selecionada;</p>\r\n<p>\r\n	Uma &aacute;rea para apresentar a imagem do paciente.</p>\r\n', 1, 1),
(1833, 2, '<p>\r\n	Ator clica no combobox e seleciona a op&ccedil;&atilde;o=&quot;J.J.&quot;</p>\r\n', '<p>\r\n	Sistema exibe a tela de consulta que cont&eacute;m:</p>\r\n<p>\r\n	Lista com os par&acirc;metros Paciente, Usu&aacute;rio, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Status do Preechimento, Turma e Op&ccedil;&otilde;es;</p>\r\n<p>\r\n	Um com combo com a op&ccedil;&atilde;o &quot;J.J.&quot; selecionada;</p>\r\n<p>\r\n	Uma &aacute;rea com a imagem do paciente &quot;J.J.&quot; selecionada.</p>\r\n', 1, 1),
(1834, 3, '<p>\r\n	Ator clica no Link=&quot;Atribuir&quot; da seguinte linha:</p>\r\n<p>\r\n	Paciente=&quot;J.J.&quot;, Usu&aacute;rio=&quot;Aluno teste&quot;, Ordem Cronol&oacute;gica=&quot;1&quot;, N&iacute;vel de Dificuldade=&quot;1&quot;, Status do Preenchimento=&quot;Em Preenchimento&quot; e Turma=&quot;DFA0037&quot;.</p>\r\n', '<p>\r\n	Sistema exibe a tela de Preenchimento da consulta que cont&eacute;m:</p>\r\n<p>\r\n	Ar&eacute;a com o relato do paciente com Nome do Paciente=&quot;J.J.&quot;, imagem do paciente e Relato em Texto;</p>\r\n<p>\r\n	Ar&eacute;a com Coment&aacute;rios do Tutor desabilitada Descri&ccedil;&atilde;o=&quot;&quot;;</p>\r\n<p>\r\n	Ar&eacute;a com conjunto de abas: Dados Demogr&aacute;ficos e Antropom&eacute;tricos (selecionada), Raz&atilde;o do Encontro, Experi&ecirc;ncia com Medicamentos, Estilo de Vida, Alergia, Medicamentos Prescritos, Medicamentos n&atilde;o Prescritos, Medicamentos Anteiores, Hist&oacute;ria do Paciente, Exames F&iacute;sicos, Par&ecirc;metro Cl&iacute;nico, Revis&atilde;o dos Sistemas e Links &Uacute;teis;</p>\r\n<p>\r\n	Bot&otilde;es Voltar, Pr&oacute;ximo e Encerrar Consulta.</p>\r\n', 1, 1),
(1835, 4, '<p>\r\n	Ator clica na aba Estilo de Vida.</p>\r\n', '<p>\r\n	Sistema permanece na tela de Preenchimento da consulta, com a aba Estilo de Vida selecionada com os seguintes dados:</p>\r\n<p>\r\n	Tabaco: Consumo=&quot;N&atilde;o&quot;, Hist&oacute;ria de Uso (Nenehum selecionada), Hist&oacute;ria Anterior de Aso=&quot;&quot;;</p>\r\n<p>\r\n	Caf&eacute;: Consumo=&quot;N&atilde;o&quot;, Hist&oacute;ria de Uso (Nenehum selecionada), Hist&oacute;ria Anterior de Aso=&quot;&quot;;</p>\r\n<p>\r\n	Alc&oacute;ol: Consumo=&quot;N&atilde;o&quot;, Tipo de bebida alco&oacute;lica=&quot;&quot;, Hist&oacute;ria de Uso (Nenehum selecionada), Hist&oacute;ria Anterior de Aso=&quot;&quot;;</p>\r\n<p>\r\n	Bot&atilde;o Salvar.</p>\r\n', 1, 1),
(1836, 5, '<p>\r\n	Ator preenche os campos da aba Estilo de Vida da seguinte forma:</p>\r\n<p>\r\n	Tabaco: Consumo=&quot;Sim&quot;, Hist&oacute;ria de Uso =&quot;1-10 Cigarros/Dia&quot;, Hist&oacute;ria Anterior de Aso=&quot;&quot;;</p>\r\n<p>\r\n	Caf&eacute;: Consumo=&quot;Sim&quot;, Hist&oacute;ria de Uso=&quot;2-6 X&iacute;caras/Dia&quot;, Hist&oacute;ria Anterior de Aso=&quot;&quot;;</p>\r\n<p>\r\n	Alc&oacute;ol: Consumo=&quot;N&atilde;o&quot;, Tipo de bebida alco&oacute;lica=&quot;&quot;, Hist&oacute;ria de Uso (N&atilde;o seleciona nenhum), Hist&oacute;ria Anterior de Aso=&quot;&quot;;</p>\r\n<p>\r\n	e clica no bot&atilde;o=&quot;Salvar&quot;</p>\r\n', '<p>\r\n	Sistema permanece na tela de Preenchimento da consulta, com a aba Estilo de vida selecionada e a mensagem de erro &quot;O campo Uso de &aacute;lcool &eacute; obrigat&oacute;rio.&quot;.</p>\r\n', 1, 1),
(1837, 1, '<p>\r\n	Ator clica na op&ccedil;&atilde;o do menu Consultas -&gt; consulta.</p>\r\n', '<p>\r\n	Sistema exibe a tela de consulta que cont&eacute;m:</p>\r\n<p>\r\n	Lista com os par&acirc;metros Paciente, Usu&aacute;rio, Ordem Cronol&oacute;gica, N&iacute;vel de Dificuldade, Status do Preechimento, Turma e Op&ccedil;&otilde;es;</p>\r\n<p>\r\n	Um com combo com a op&ccedil;&atilde;o &quot;Listar Todos&quot; selecionada;</p>\r\n<p>\r\n	Uma &aacute;rea para apresentar a imagem do paciente.</p>\r\n', 1, 1),
