(1, '<p>\r\n	O sistema de biblioteca realiza empr&eacute;stimo e devolu&ccedil;&otilde;es de livros para usu&aacute;rios cadastrados.</p>', '', 1, 0, 0, 0, 'O:8:"stdClass":4:{s:19:"requirementsEnabled";i:1;s:19:"testPriorityEnabled";i:1;s:17:"automationEnabled";i:1;s:16:"inventoryEnabled";i:1;}', 'CT', 18, 1, 0, 0),
(2, '<p>\r\n	Projeto Residential Life visa administrar cada setor de um condom&iacute;nio.</p>', '', 1, 0, 0, 0, 'O:8:"stdClass":4:{s:19:"requirementsEnabled";i:1;s:19:"testPriorityEnabled";i:1;s:17:"automationEnabled";i:1;s:16:"inventoryEnabled";i:1;}', 'RL', 104, 1, 0, 0),
(3, '<p>\r\n	&nbsp;O sistema auxilia a gerencia de um est&uacute;dio fotogr&aacute;fico.</p>', '', 1, 0, 0, 0, 'O:8:"stdClass":4:{s:19:"requirementsEnabled";i:1;s:19:"testPriorityEnabled";i:1;s:17:"automationEnabled";i:1;s:16:"inventoryEnabled";i:1;}', 'MissM', 107, 1, 0, 0),
(29, '<p>\r\n	Sistema de Cl&iacute;nica M&eacute;dica</p>', '', 1, 0, 0, 0, 'O:8:"stdClass":4:{s:19:"requirementsEnabled";i:1;s:19:"testPriorityEnabled";i:1;s:17:"automationEnabled";i:1;s:16:"inventoryEnabled";i:1;}', 'SM', 59, 1, 0, 0),
(1149, '<p>\r\n	O objetivo da Sistematiza&ccedil;&atilde;o da Assist&ecirc;ncia em Enfermagem (SAE) &eacute; utilizar m&eacute;todos para identificar os problemas do processo de sa&uacute;de. A implanta&ccedil;&atilde;o da SAE nas institui&ccedil;&otilde;es de sa&uacute;de torna-se um desafio devido &agrave;s defici&ecirc;ncias na forma&ccedil;&atilde;o dos profissionais de enfermagem respons&aacute;veis pela sua aplica&ccedil;&atilde;o. O presente projeto visa possibilitar ao aluno de enfermagem a viv&ecirc;ncia, por meio de um ambiente virtual, al&eacute;m da capacidade de percep&ccedil;&atilde;o mais apurada e a tomada de decis&atilde;o fundamentada.</p>', '', 1, 0, 0, 0, 'O:8:"stdClass":4:{s:19:"requirementsEnabled";i:1;s:19:"testPriorityEnabled";i:0;s:17:"automationEnabled";i:0;s:16:"inventoryEnabled";i:0;}', 'PV', 321, 1, 0, 0);
